import React, {Component} from "react";
import Clock from 'react-live-clock';
class Clock_check_now extends Component{
    render(){
        return(
        <div>
            <_Clock format={'HH:mm:ss'} ticking = {true} />
        </div>

        );
    }
}

export default Clock_check_now;
